import React from 'react'
import './FeaturedSection.css';
import ProjectCard from './ProjectCard';

const FeaturedSection = () => {
  return (
    <div className="featured-section">
        <h3>Featured projects</h3>
        <div className="cards">
            <ProjectCard 
                title={"NFC contact card"}
                tags={["hardware"]}
                description={"A PCB contact card that can be used to share contact information with others by tapping it to their phone"}
                img={"../../imgs/contact-card.jpg"}
            />
            <ProjectCard 
                title={"Remote control"}
                tags={["hardware, robotics"]}
                description={"Remote control module built from scratch"}
                img={"../../imgs/remote.jpg"}
            />
            <ProjectCard 
                title={"Remote control"}
                tags={["hardware, robotics"]}
                description={"Remote control module built from scratch"}
                img={"../../imgs/remote.jpg"}
            />
        </div>
    </div>
  )
}

export default FeaturedSection;
